/* harmony default export */ __webpack_exports__["default"] = ("<div>\n  <div class=\"image\">\n    <img src=\"assets/linux.jpg\" alt=\"software\" class=\"main-imagen\" />\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-sm-12 edicion\">\n      <h1>LINUX - UBUNTU 18.04</h1>\n\n      <p>\n        Ubuntu es un sistema operativo de código abierto y libre para\n        computadores. Es una distribución de Linux basada en Debian. Actualmente\n        corre en computadores de escritorio y servidores. Está orientado al\n        usuario promedio, con un fuerte enfoque en la facilidad de uso y en\n        mejorar la experiencia del usuario. Está compuesto de múltiple software\n        normalmente distribuido bajo una licencia libre o de código abierto.\n        Estadísticas web sugieren que la cuota de mercado de Ubuntu dentro de\n        las distribuciones Linux es, aproximadamente, del 52 %,3​4​ y con una\n        tendencia a aumentar como servidor web.5\n      </p>\n\n      <h1>Caracteristicas Principales</h1>\n\n      <ul>\n        <li>\n          1. Escritorio de GNOME 3.28 En caso de que no haya probado Ubuntu\n          17.10 Artful Aardvark, 18.04 LTS va a ser una experiencia\n          completamente nueva para usted. Con 17.10, Canonical ya ha hecho un\n          cambio al escritorio GNOME como predeterminado con algunos ajustes.\n          Entonces, para los usuarios de LTS existentes, las cosas van a ser\n          bastante nuevas. Acerca de la versión de GNOME, podemos esperar que\n          GNOME 3.28 se envíe con 18.04.\n        </li>\n        <li>\n          2. Kernel 4.15 “Cada 6 meses, el equipo Kernel de Ubuntu tiene la\n          tarea de elegir el kernel para usar en la próxima versión. Nos fijamos\n          en el calendario de lanzamientos de Ubuntu y cómo se alineará con las\n          versiones de kernel en sentido ascendente “, escribió el equipo Kernel\n          de Ubuntu en una publicación reciente. El equipo espera que Linux\n          kernel 4.15 alimente Ubuntu 18.04. Algunas de las características\n          notables de Kernel 4.15 son:\n          <p>\n            -Soporte de encriptación de memoria segura\n          </p>\n          <p>\n            -AMD Mejor administración de energía Controlador de CPU para la\n            interfaz cgroup v2\n          </p>\n          <p>\n            -Mejor soporte para hardware antiguo y nuevo\n          </p>\n          <p>\n            -Últimos controladores y correcciones\n          </p>\n        </li>\n        <li>\n          3. Nuevo tema de escritorio e icono (Pospuesto a la próxima versión)\n          Actualización: este cambio se ha pospuesto a 18.10 versión. Aunque\n          Ubuntu 17.10 ha sido sometido a una revisión con el escritorio de\n          GNOME, su apariencia todavía se parece mucho a las versiones\n          anteriores de Ubuntu. En base a los comentarios generales de la\n          comunidad, el equipo busca incluir un nuevo tema de escritorio y de\n          icono para la versión 18.04.\n        </li>\n        <li>\n          4. Xorg por defecto Con vencimiento en abril de 2018, el próximo\n          lanzamiento de LTS vendrá con gráficos tradicionales de Xorg y nueva\n          pila basada en Wayland. Sin embargo, Xorg será el predeterminado. El\n          equipo de desarrollo de Ubuntu ha enumerado diferentes motivos para\n          esta elección, incluido un mejor rendimiento de software como\n          Hangouts, Skype y servicios WebRTC en Xorg. También se recupera mejor\n          de los accidentes de Shell. Para Ubuntu 18.10, el equipo volverá a\n          evaluar Wayland como el valor predeterminado.\n        </li>\n        <li>\n          Opción de instalación mínima Junto con la próxima versión de Ubuntu\n          18.04 LTS, los usuarios podrán realizar una instalación ligera de\n          Ubuntu . Esta opción eliminará muchos paquetes de software y obtendrá\n          un sistema con un entorno de escritorio, navegador web, herramientas\n          del sistema central y mucho más. Esta opción aparecerá en el\n          instalador de Ubuntu. Tenga en cuenta que no es un reemplazo de Ubuntu\n          Minimal ISO preexistente.\n        </li>\n        <li>\n          6. Ubuntu recogerá algunos datos Según un reciente anuncio hecho en la\n          lista de correo de Ubuntu, Canonical comenzará a recopilar algunos\n          datos del usuario relacionados con la configuración del sistema y\n          paquetes instalados en la máquina. A partir de Ubuntu 18.04 LTS, esta\n          opción de exclusión se proporcionará en el instalador. Lea sobre esta\n          característica esperada en detalle aquí.\n        </li>\n        <li>\n          7. Nuevo instalador para Ubuntu Server Con Ubuntu 18.04, Canonical\n          finalmente actualizará el instalador de línea de comando del Servidor\n          Ubuntu. El nuevo instalador llamado Subiquity será el predeterminado\n          en la próxima versión de LTS. Este cambio le dará un nuevo aspecto al\n          proceso de instalación del servidor, que hasta ahora había sido el\n          instalador basado en texto de Debian.\n        </li>\n        <li>\n          8. Soporte para emojis de color Sí, coloridos emojis finalmente están\n          llegando al escritorio de Ubuntu. Esta nueva característica le\n          permitirá mostrar emoji de color en diferentes aplicaciones. A pesar\n          de que muchos entusiastas fanáticos de Linux negarán que se trata de\n          un desarrollo que merezca mucha atención, los emojis son importantes\n          en los mensajes y las comunicaciones actuales. Por lo tanto, poder ver\n          emojis en su colorido atuendo es agradable.\n        </li>\n        <li>\n          9. Tiempo de arranque más rápido Canonical también está trabajando\n          para acelerar el tiempo de arranque de Ubuntu mediante el uso de las\n          características de systemd. Este es un cambio emocionante y será\n          interesante ver lo que el equipo de escritorio logra lograr en esta\n          área.\n        </li>\n        <li>\n          10. Soporte para el algoritmo de compresión zstd Con el algoritmo de\n          compresión zstd de Facebook, ahora puede esperar una velocidad de\n          instalación de Ubuntu más rápida de aproximadamente 10% con 18.04.\n        </li>\n        <li>\n          11. OpenJDK 10 La versión de Ubuntu 18.04 viene con OpenJDK 10 como\n          predeterminado. Después de que OpenJDK 11 se envíe a finales de este\n          año en septiembre, será el predeterminado.\n        </li>\n        <li>\n          12. Cambios de red y mejoras Los principales cambios relacionados con\n          la configuración de red en Ubuntu 18.04 son:\n          <p>\n            systemd-resolved es la resolución DNS predeterminada\n          </p>\n          <p>\n            NetworkManager viene con soporte de equipo con libteam\n          </p>\n          <p>\n            Ifupdown depcrecated; netplan.io agregado\n          </p>\n          <p>\n            Comando networkctl disponible para ver el resumen del dispositivo de\n            red\n          </p>\n        </li>\n        <li>\n          13. Nuevos fondos de pantalla No hace falta decir que Ubuntu 18.04\n          viene con hermosos fondos de pantalla nuevos que han sido aportados\n          por la comunidad a través del concurso Ubuntu 18.04 LTS Free Cultural\n          Showcase.\n        </li>\n        <img src=\"assets/linux-menu.jpg\" alt=\"\" />\n      </ul>\n      <h1>Como instalar Ubuntu 18.04 en tu equipo</h1>\n      <h2>Requisitos:</h2>\n      <ul>\n        <li>Un puerto USB disponible o libre en tu ordenador</li>\n        <li>\n          Un USB de al menos 4 GB\n        </li>\n        <li>Imagen de Ubuntu 18.04</li>\n        <li>Descargar Rufus, version portable o instalable</li>\n      </ul>\n      <h1>Pasos a seguir</h1>\n      <h3>Paso 1: Crear memoria booteable con imagen de Linux Ubuntu 18.04</h3>\n      <ul>\n        <li>\n          Conecta tu USB al ordenador y asegúrate de respaldar cualquier archivo\n          importante en él antes de continuar, puesto que este proceso borrará\n          todos los datos que contenga.\n        </li>\n        <li>\n          Ejecuta Rufus (se recomienda descargar la version portable,\n          <a\n            href=\"https://github.com/pbatard/rufus/releases/download/v3.8/rufus-3.8p.exe\"\n            >click aqui para descargar</a\n          >)\n        </li>\n        <li>\n          Una vez descargado lo ejecutamos y nos mostrara esta ventana\n        </li>\n        <img src=\"assets/rufus-1.jpg\" alt=\"\" />\n        <li>\n          Seleccionamos nuestra memoria USB en la lista que aparece arriba\n        </li>\n        <li>\n          Damos click en el boton de Seleccionar donde se nos abrira un\n          seleccionador de archivos, elegiremos la imagen iso del sistema\n          operativo que vamos a bootear\n        </li>\n\n        <li>\n          Si se desea cambiar el nombre al dispositivo, se lo pondremos donde\n          dice etiqueta de volumen\n        </li>\n        <li>\n          El Esquema de Particion tiene que estar en MBR para que al momento de\n          bootear desde la bios detecte la memoria como un sistema UEFI, si no\n          no se ejecutara por proteccion al sistema de la bios\n        </li>\n        <li>\n          Le daremos click a Empezar para que comience el formateo y\n          configuracion de la memoria USB y solo esperamos a que el proceso\n          termine\n        </li>\n        <img src=\"assets/rufus-2.jpg\" alt=\"\" />\n        <img src=\"assets/rufus-3.jpg\" alt=\"\" />\n      </ul>\n\n      <h1>Paso 2: Ejecutar Memoria desde la Bios del Equipo</h1>\n      <ul>\n        <li>\n          Para eso Reiniciaremos el equipo y presionaremos la tecla\n          correspondiente para arrancar la bios (generalmente las teclas son F2\n          F10 o F12)\n        </li>\n        <img src=\"assets/boot.jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Nos aparacera una pantalla similar a esta, simplemente seleccionamos\n          nuestra memoria usb y le damos Enter\n        </li>\n        <img src=\"assets/Linux (2).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Aparecera la pantalla morada con el simbolo de Ubuntu y eso significa\n          que empezo a cargar el paquete de instalacion\n        </li>\n        <img src=\"assets/Linux (3).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Luego nos mostrara esta ventana donde nos pedira que seleccionemos el\n          idioma del equipo.\n        </li>\n        <img src=\"assets/Linux (4).jpg\" alt=\"\" class=\"imagen\" />\n        <img src=\"assets/Linux (5).jpg\" alt=\"\" class=\"imagen\" />\n\n        <li>\n          Despues nos pedira que selecciones la distribucion de teclado que\n          tenemos o que deseamos utilizar\n        </li>\n\n        <img src=\"assets/Linux (6).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Posteriormente nos conectaremos a una red de internet para continuar\n          la configuracion o podemos brincarnos este paso si se desea\n        </li>\n\n        <img src=\"assets/Linux (7).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Ahora nos da a escoger entre dos opciones de instalacion, para hacerlo\n          de la manera mas adecuada, seleccionaremos la normal done instalara\n          todo los paquetes necesarios y actualizaciones\n        </li>\n\n        <img src=\"assets/Linux (8).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Si contamos con otro sistema operativo instalado en nuestro disco\n          duro, nos preguntara si queremos instalar Ubuntu junto al otro sistema\n          o si deseamos borrar todo el disco para dejar solo el sistema de Linux\n          instalado, en este caso seleccionamos la opcion de instalarlo junto a\n          Windows\n        </li>\n        <img src=\"assets/Linux (9).jpg\" alt=\"\" class=\"imagen\" />\n\n        <li>\n          Seleccionamos la unidad que deseamos utilizar para la instalacion del\n          sistema, una vez que sepamos cual unidad utilizaremos, tenemos que\n          seleccionar el tipo de formato que llevara en este caso seleccionamos\n          ext4, y lo seleccionamos como raiz, es la opcion que señala una\n          diagonal \"/\"\n        </li>\n\n        <img src=\"assets/Linux (10).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Y le damos en Formatear para obtener el formato adecuado para la\n          instalacion del sistema y una vez formateado le damos instalar ahora,\n          donde nos lanzara una advertencia de si estamos seguros de la\n          configuracion escrita, le damos que si\n        </li>\n\n        <img src=\"assets/Linux (11).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Casi para terminar nos pedira que seleccionesmos la region o lugar\n          donde nos encontramos\n        </li>\n        <img src=\"assets/Linux (12).jpg\" alt=\"\" class=\"imagen\" />\n\n        <li>\n          Como ultimo paso ingresaremos los datos del equipo, como nombre del\n          equipo, nombre de la cuenta, y alguna contraseña de acceso\n        </li>\n        <img src=\"assets/Linux (13).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Finalmente comenzara la instalacion de Ubuntu, copiara archivos,\n          extraera y empezara a actualizar recursos necesarios para comenzar con\n          su uso, esto tomara unos cuantos minutos y una vwez finalizado se\n          reiniciara la computadora, solo hay que dejar que cargue el sistema\n          operativo y comenzaremos con la configuracion\n        </li>\n\n        <img src=\"assets/Linux (14).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Una vez terminado nos pedira que reiniciemos la computadora para que\n          podamos ejecutar el sistema operativo\n        </li>\n        <img src=\"assets/Linux (15).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Cuando reiniciemos nos saldra el GRUB o el sistema de seleccion de\n          sistema operativo por el cual queremos que inicie, en nuestro caso\n          iniciaremos con ubuntu\n        </li>\n\n        <img src=\"assets/Linux (16).jpg\" alt=\"\" class=\"imagen\" />\n\n        <li>Y listo, ya tienes Linux Ubuntu 18.04 configurado en tu equipo</li>\n      </ul>\n    </div>\n  </div>\n</div>\n");

