/* harmony default export */ __webpack_exports__["default"] = ("<div>\n  <div class=\"image\">\n    <img\n      src=\"assets/windows-10.jpg\"\n      alt=\"software\"\n      class=\"main-imagen\"\n    />\n  </div>\n\n  <div class=\"row\">\n    <div class=\"col-sm-12 edicion\">\n      <h1>WINDOWS 10</h1>\n      <p>\n        Windows 10 es el vigente sistema operativo desarrollado por Microsoft\n        como parte de la familia de sistemas operativos Windows NT.​ Fue dado a\n        conocer oficialmente en septiembre de 2014, seguido por una breve\n        presentación de demostración en la conferencia Build 2014. Entró en fase\n        beta de prueba en octubre de 2014 y fue lanzado al público en general el\n        29 de julio de 2015. Esta edición introdujo una arquitectura de\n        aplicaciones «universales». Desarrolladas con la interfaz Continuum y,\n        posteriormente, con la interfaz Fluent Design, estas aplicaciones pueden\n        ser diseñadas para ejecutarse en todas las familias de productos de\n        Microsoft con un código casi idéntico (incluyendo computadoras\n        personales, tabletas, teléfonos inteligentes, sistemas embebidos, Xbox\n        One, Surface Hub y HoloLens). La interfaz de usuario fue revisada para\n        realizar transiciones entre una interfaz orientada al ratón y una\n        interfaz orientada a la pantalla táctil basadas en dispositivos de\n        entrada disponibles (particularmente en tabletas). Ambas interfaces\n        incluyen un menú Inicio actualizado que comprende un diseño mezclado de\n        Windows 7 con el diseño metro de Windows 8. También se introduce la\n        Vista de Tareas, un sistema de escritorio virtual, el navegador web\n        Microsoft Edge y otras aplicaciones nuevas o actualizadas, un soporte\n        integrado para iniciar sesión a través de huella digital o\n        reconocimiento facial llamado Windows Hello, nuevas características de\n        seguridad para entornos empresariales, DirectX 12 y WDDM 2.0 para\n        mejorar las capacidades gráficas del sistema operativo para los\n        videojuegos.\n      </p>\n      <h1>Caracteristicas Principales</h1>\n      <ul>\n        <li>\n          1-La interfaz de Windows 10 está concebida para funcionar en aparatos\n          de pantalla táctil, como las de tabletas y teléfonos inteligentes\n          --con las cuales Microsoft está un poco rezagado--, pero también en\n          computadoras clásicas por medio de un ratón y un teclado.\n        </li>\n        <li>\n          2-El \"menú de inicio\", que antiguamente permitía acceder a la mayoría\n          de las funciones y programas hasta que Windows 8 la borró totalmente,\n          vuelve a aparecer en la esquina inferior izquierda de la pantalla.\n        </li>\n        <li>\n          3-Una nueva función intuitiva, bautizada \"Continuum\", permite alternar\n          automáticamente de la interfaz clásica a la táctil en los aparatos que\n          son \"dos en uno\", como la Surface de Microsoft, que funciona a la vez\n          como tableta y como ordenador portátil gracias a un teclado removible.\n        </li>\n        <li>\n          4-\"Windows Hello\" es un nuevo sistema de autenticación biométrica que\n          se supone permitirá reemplazar las contraseñas. El aparato deberá no\n          obstante ser compatible.\n        </li>\n        <li>\n          5-El asistente virtual Cortana, rival de Siri de Apple y ya integrado\n          en los smartphones, hace su debut en los ordenadores con Windows 10.\n          Cortana utiliza el motor de búsqueda de Microsoft, Bing, para hallar\n          archivos o datos que pueden estar en el disco o en internet.\n        </li>\n        <li>\n          6-Un nuevo navegador más rápido, Edge, reemplazará al Internet\n          Explorer y está concebido para funcionar con Cortana.\n        </li>\n        <li>\n          7-Un panel llamado \"Centro de acción\" organiza las notificaciones y\n          permite ajustar las configuraciones personales.\n        </li>\n        <li>\n          8-Una nueva aplicación permite transmitir por streaming (difusión en\n          línea) los partidos que se juegan en la consola de videojuegos Xbox,\n          también producida por Microsoft.\n        </li>\n        <li>\n          9-Windows 10 también actualiza su sistema integrado de protección\n          contra los virus, el phishing (ataques por suplantación de identidad)\n          y el malware (programas maliciosos).\n        </li>\n        <img src=\"assets/win-menu.jpg\" alt=\"\" />\n      </ul>\n      <h1>Como instalar Windows 10 en tu equipo</h1>\n      <h2>Requisitos:</h2>\n      <ul>\n        <li>Un puerto USB disponible o libre en tu ordenador</li>\n        <li>\n          Un USB de al menos 8 GB\n        </li>\n        <li>Imagen de Windows 10</li>\n        <li>Descargar Rufus, version portable o instalable</li>\n      </ul>\n      <h1>Pasos a seguir</h1>\n      <h3>Paso 1: Crear memoria booteable con imagen de Windows 10</h3>\n      <ul>\n        <li>\n          Conecta tu USB al ordenador y asegúrate de respaldar cualquier\n          archivo importante en él antes de continuar, puesto que este proceso\n          borrará todos los datos que contenga.\n        </li>\n        <li>\n          Ejecuta Rufus (se recomienda descargar la version portable,\n          <a\n            href=\"https://github.com/pbatard/rufus/releases/download/v3.8/rufus-3.8p.exe\"\n            >click aqui para descargar</a\n          >)\n        </li>\n        <li>\n          Una vez descargado lo ejecutamos y nos mostrara esta ventana\n        </li>\n        <img src=\"assets/rufus-1.jpg\" alt=\"\" />\n        <li>\n          Seleccionamos nuestra memoria USB en la lista que aparece arriba\n        </li>\n        <li>\n          Damos click en el boton de Seleccionar donde se nos abrira un\n          seleccionador de archivos, elegiremos la imagen iso del sistema\n          operativo que vamos a bootear\n        </li>\n        <li>\n          Si quieres descargar el ISO de Windows 10 usando Rufus haz click en la\n          flecha hacia abajo junto al botón de seleccionar para cambiar a\n          DESCARGA:\n        </li>\n        <li>\n          Haz click en el botón DESCARGA y espera unos segundos a que aparezca\n          una nueva ventana para seleccionar sistema operativo:\n        </li>\n        <li>\n          Selecciona Windows 10 en este caso y haz click en Continuar. Luego\n          deberás seleccionar le \"emisión\" o versión de Windows 10. Te\n          recomiendo seleccionar la más reciente (puedes ver las fechas de\n          lanzamiento junto a la versión) para evitar tener que actualizar\n          Windows después. Luego haz click en \"Continuar\".\n        </li>\n        <li>\n          Selecciona la edición de Windows 10, ya sea \"Home/Pro\" o \"Education\".\n          Recuerda que esto dependerá del tipo de licencia que tengas. Si tienes\n          dudas, selecciona siempre \"Home/Pro\" que son las que usan los usuarios\n          individuales. Haz click en \"Continuar\" para elegir el idioma y luego\n          la arquitectura. Elige x64 salvo que tengas un ordenador demasiado\n          antiguo.\n        </li>\n        <li>\n          Finalmente, seleccionar \"Descargar\" y una carpeta donde\n        </li>\n        <li>\n          guardar tu ISO usando el explorador de archivos.\n        </li>\n        <li>\n          Si se desea cambiar el nombre al dispositivo, se lo pondremos donde\n          dice etiqueta de volumen, el resto de configuraciones lo dejamos como\n          esta\n        </li>\n        <li>\n          Le daremos click a Empezar para que comience el formateo y\n          configuracion de la memoria USB y solo esperamos a que el proceso\n          termine\n        </li>\n        <img src=\"assets/rufus-2.jpg\" alt=\"\" />\n        <img src=\"assets/rufus-3.jpg\" alt=\"\" />\n      </ul>\n\n      <h1>Paso 2: Ejecutar Memoria desde la Bios del Equipo</h1>\n      <ul>\n        <li>\n          Para eso Reiniciaremos el equipo y presionaremos la tecla\n          correspondiente para arrancar la bios (generalmente las teclas son F2\n          F10 o F12)\n        </li>\n        <img src=\"assets/boot.jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Nos aparacera una pantalla similar a esta, simplemente seleccionamos\n          nuestra memoria usb y le damos Enter\n        </li>\n        <img src=\"assets/windows (2).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Aparecera la pantalla negra con el simbolo de windows y eso significa\n          que empezo a cargar el paquete de instalacion\n        </li>\n        <img src=\"assets/windows (3).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Luego nos mostrara esta ventana donde nos pedira que seleccionemos el\n          idioma del equipo, asi como el formato de moneda y teclado que\n          utilizaremos\n        </li>\n        <img src=\"assets/windows (4).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Le damos click al boton de instalar\n        </li>\n        <img src=\"assets/windows (5).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Aceptamos los avisos y terminos de licencia dando click en el check y\n          le damos siguiente\n        </li>\n        <img src=\"assets/windows (6).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Nos da a escoger entre dos opciones de instalacion, para hacerlo de la\n          manera mas adecuada, seleccionaremos la Personalizada\n        </li>\n        <img src=\"assets/windows (7).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Seleccionamos la unidad que deseamos utilizar para la instalacion del\n          sistema\n        </li>\n        <img src=\"assets/windows (8).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Y le damos en Formatear para obtener el formato adecuado para la\n          instalacion del sistema y una vez formateado le damos siguiente\n        </li>\n        <img src=\"assets/windows (9).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Comenzara la instalacion de windows, copiara archivos, extraera y\n          empezara a actualizar recursos necesarios para comenzar con su uso,\n          esto tomara unos cuantos minutos y una vwez finalizado se reiniciara\n          la computadora, solo hay que dejar que cargue el sistema operativo y\n          comenzaremos con la configuracion\n        </li>\n        <img src=\"assets/windows (10).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Lo primero que nos pedira que elijamos sera la region en la que nos\n          encontramos\n        </li>\n        <img src=\"assets/windows (11).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Despues elegiremos la distribucion del teclado que deseamos utilizar,\n          esto se refiere a el tipo de acomodo de teclas que contamos en nuestro\n          teclado\n        </li>\n        <img src=\"assets/windows (12).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Nos preguntara si deseamos agregar una distribucion extra, esto a es a\n          eleccion del usuario.\n        </li>\n        <img src=\"assets/windows (13).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Posteriormente nos conectaremos a una red de internet para continuar\n          la configuracion\n        </li>\n        <img src=\"assets/windows (14).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Podemos iniciar en nuestra sesion de hotmail u outlook o podemos\n          elegir tener una cuenta local\n        </li>\n        <img src=\"assets/windows (15).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Puedes ingresar un pin numerico para poder acceder al equipo, o si se\n          desea puede ser alfanumerico (letras y numeros), de no desearse puede\n          omitirse este paso\n        </li>\n        <img src=\"assets/windows (16).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Podras elegir en darle autorizacion a microsoft para personalizar aun\n          mejor tu experiencia de usuario\n        </li>\n        <img src=\"assets/windows (17).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Si lo deseas, puedes agregar un numero telefonico para enlazarlo a tu\n          cuenta de microsoft, lo que te permite acceder a distintas funciones\n        </li>\n        <img src=\"assets/windows (18).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Si accediste con tu cuenta microsoft te preguntara si deseas activar\n          tu cuenta de One Drive, es un almacenamiento en la nube para respaldar\n          archivos de manera automatica, es a eleccion dle usuario\n        </li>\n        <img src=\"assets/windows (19).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Finalmente solo queda esperar a que windows termine de configurarse,\n          te mostrara letreros del avance, tarda de 2 a 5 minutos dependiendo\n          del equipo.\n        </li>\n        <img src=\"assets/windows (20).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          \"Lo estamos preparando todo para ti\"\n        </li>\n        <img src=\"assets/windows (21).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Tarda de 2 a 5 minutos en terminar de configurarse el sistema\n          operativo, es el ultimo paso.\n        </li>\n        <img src=\"assets/windows (22).jpg\" alt=\"\" class=\"imagen\" />\n        <li>\n          Finalmente, lo primero que te muestra es Edge, el navegador de\n          windows, para configurarlo a tu gusto.\n        </li>\n        <img src=\"assets/windows (1).jpg\" alt=\"\" class=\"imagen\" />\n        <li>Y listo, ya tienes windows 10 configurado en tu equipo</li>\n      </ul>\n    </div>\n  </div>\n</div>\n");

